version_description:
1、Fix the bug in iOS9；
2、Add photo thumbnail view；
3、Fix photo view bug；
4、Fix copy photo lost bug；
5、Addition of brief introduction to App booting screens in Simplified Chinese, Traditional Chinese, French, Spanish, and German;
6、Updated display characters on the main interface in Simplified Chinese, Traditional Chinese, French, Spanish, and German.
7、Addition of camera feature;
8、Addition of voice recording feature;
9、Addition of txt files creating and editing features;
10、Addition of search feature;
11、Addition of file-renaming feature;
12、Addition of sliding browse feature to the images of external disk;
13、Addition of sliding browse feature to the images of photo gallery;
14、Addition of file sorting feature based on file names, dates, formats, sizes, and folders.

